import "./post.css"

export default function Post() {
  const [games, setGames] = useState([]);

  useEffect(() => {
    fetch("http://localhost:9292/games")
      .then((r) => r.json())
      .then((games) => setGames(games));
  }, []);
  return (
    <div className="posts">

    </div>
  )
}





